on by a military court for a crime they didn\'t commit.... Wait, no. That\'s\\",\\"html\\":{\\"type\\":\\"writer\\",\\"features\\":\\"\\"}},\\"entityId\\":\\"5-245682846\\"},\\"5-278642117\\":{\\"deviationId\\":278642117,\\"type\\":\\"journal\\",\\"typeId\\":5,\\"printId\\":null,\\"url\\":\\"https:\\\\u002F\\\\u002Fwww.deviantart.com\\\\u002Fkouiskas\\\\u002Fjournal\\\\u002FAbout-this-Nicolas-Cage-situation-278642117\\",\\"title\\":\\"About this Nicolas Cage situation\\",\\"isJournal\\":true,\\"isVideo\\":false,\\"isPurchasable\\":false,\\"isFavouritable\\":false,\\"publishedTime\\":\\"2012-01-10T11:04:51-0800\\",\\"isTextEditable\\":false,\\"legacyTextEditUrl\\":\\"https:\\\\u002F\\\\u002Fsta.sh\\\\u002Fwriter#278642117\\",\\"isShareable\\":true,\\"isCommentable\\":true,\\"isFavourited\\":false,\\"isDeleted\\":false,\\"isMature\\":false,\\"isDownloadable\\":false,\\"isAntisocial\\":false,\\"isBlocked\\":false,\\"isPublished\\":true,\\"isDailyDeviation\\":false,\\"hasPrivateComments\\":false,\\"blockReasons\\":[],\\"author\\":11290129,\\"stats\\":{\\"comments\\":442,\\"favourites\\":29},\\"media\\":{\\"types\\":[]},\\"textContent\\":{\\"excerpt\\":\\"Edit: I\'ve just woken up to a night\'s worth of replies to this journal and people have made a great point about the fact that I could put these deviations in storage until the situation has ended, which I just have. If you are new to the conversation and wonder what kind of deviation we\'re talking about, they are the same kind of montages seen on that blog: http:\\\\u002F\\\\u002Fniccageaseveryone.blogspot.com\\\\u002F\\\\n\\\\nAs you can easily guess from the stats on my profile, I don\'t post very often. I try to, because it\'s important to use the website I help build. So when last year, for fun, I made these montages I thought it might make people I\'m in touch with on dA\\",\\"html\\":{\\"type\\":\\"writer\\",\\"features\\":\\"\\"}},\\"entityId\\":\\"5-278642117\\"}},\\"deviationExtended\\":{\\"145564099\\":{\\"